// routesConfig.js
export default [
    { path: "/", redirect: "/login" },
    { path: "/login", name: "Login", component: () => import("../views/LoginView.vue") },
    { path: "/home", name: "Home", component: () => import("../views/HomeView.vue"), meta: { requiresAuth: true } },
    { path: "/employee", name: "User", component: () => import("../views/EmployeeListView.vue"), meta: { requiresAuth: true } },
    { path: "/setting", name: "Setting", component: () => import("../views/SettingView.vue"), meta: { requiresAuth: true } },
  ];
